import React, { useState } from 'react';
import { addEvent } from '../api';

export default function AddEvent({ user, onBack }){
  const [form, setForm] = useState({ name:'', description:'', start_datetime:'', end_datetime:'', issue_date:'', location:'', level:'jila', event_type:'meeting' });
  const [photos, setPhotos] = useState([]);
  const [media, setMedia] = useState([]);
  const [video, setVideo] = useState(null);

  async function submit(e){
    e.preventDefault();
    const fd = new FormData();
    fd.append('name', form.name);
    fd.append('description', form.description);
    fd.append('start_datetime', form.start_datetime);
    fd.append('end_datetime', form.end_datetime);
    fd.append('issue_date', form.issue_date);
    fd.append('location', form.location);
    fd.append('level', form.level);
    fd.append('event_type', form.event_type);
    fd.append('created_by', user.id);
    for (const f of photos) fd.append('photos', f);
    for (const f of media) fd.append('media_photos', f);
    if (video) fd.append('video', video);
    const r = await addEvent(fd);
    if (r.error) alert(r.error); else { alert('इवेंट जुड़ गया'); onBack(); }
  }

  return (
    <div>
      <button className='button secondary' onClick={onBack}>वापस</button>
      <h3>नया इवेंट जोड़ें</h3>
      <form onSubmit={submit}>
        <div><label>नाम: <input value={form.name} onChange={e=>setForm({...form, name:e.target.value})} /></label></div>
        <div><label>विवरण: <textarea value={form.description} onChange={e=>setForm({...form, description:e.target.value})} /></label></div>
        <div><label>शुरू: <input value={form.start_datetime} onChange={e=>setForm({...form, start_datetime:e.target.value})} placeholder='YYYY-MM-DD HH:MM:SS' /></label></div>
        <div><label>समाप्त: <input value={form.end_datetime} onChange={e=>setForm({...form, end_datetime:e.target.value})} placeholder='YYYY-MM-DD HH:MM:SS' /></label></div>
        <div><label>Issue Date: <input value={form.issue_date} onChange={e=>setForm({...form, issue_date:e.target.value})} placeholder='YYYY-MM-DD' /></label></div>
        <div><label>स्थान: <input value={form.location} onChange={e=>setForm({...form, location:e.target.value})} /></label></div>
        <div><label>स्तर: <select value={form.level} onChange={e=>setForm({...form, level:e.target.value})}><option value='jila'>jila</option><option value='block'>block</option></select></label></div>
        <div><label>इवेंट प्रकार: <select value={form.event_type} onChange={e=>setForm({...form, event_type:e.target.value})}><option value='Dhrana'>Dhrana</option><option value='meeting'>meeting</option><option value='band'>band</option><option value='raily'>raily</option><option value='sabha'>sabha</option><option value='gayapan'>gayapan</option></select></label></div>
        <div><label>Photos (max 10): <input type='file' multiple accept='image/*' onChange={e=>setPhotos(e.target.files)} /></label></div>
        <div><label>Media Photos (max 5): <input type='file' multiple accept='image/*' onChange={e=>setMedia(e.target.files)} /></label></div>
        <div><label>Video (&gt;=10MB): <input type='file' accept='video/*' onChange={e=>setVideo(e.target.files[0])} /></label></div>
        <div style={{marginTop:10}}><button className='button' type='submit'>जोड़ें</button></div>
      </form>
    </div>
  );
}
